/**
 * AUDIO DATA MODULE
 * Містить Base64 дані аудіо файлів для вирішення CORS проблем
 * Використовується замість локальних файлів для забезпечення сумісності
 */

// ===== BASE64 АУДІО ДАНІ =====

/**
 * Base64 дані аудіо файлів
 * Конвертовані з оригінальних MP3 файлів для уникнення CORS обмежень
 */
const AUDIO_BASE64_DATA = {
    // Звук обертання барабанів
    drumSpin: 'data:audio/mpeg;base64,',
    
    // Звук результату розіграшу
    resultDing: 'data:audio/mpeg;base64,',
    
    // Звук перемоги
    victoryFanfare: 'data:audio/mpeg;base64,'
};

// ===== ЕКСПОРТ МОДУЛЯ =====

/**
 * Експорт Base64 аудіо даних через window об'єкт
 * для сумісності з архітектурою проекту
 */
window.AudioData = {
    // Отримати Base64 дані для конкретного звуку
    getAudioData: function(soundName) {
        return AUDIO_BASE64_DATA[soundName] || null;
    },
    
    // Отримати всі доступні звуки
    getAllSounds: function() {
        return Object.keys(AUDIO_BASE64_DATA);
    },
    
    // Перевірити чи існує звук
    hasSound: function(soundName) {
        return soundName in AUDIO_BASE64_DATA;
    },
    
    // Прямий доступ до даних (для зворотної сумісності)
    data: AUDIO_BASE64_DATA
};